The previous example worked as expected but it contains some hard-coded cell ranges like set_values("Sheet1!$B$2:$B$5") and Formula::new("=SUM(B2:B5)"). If our example changed to have a different number of data items then we would have to manually change the code to adjust for the new ranges. Fortunately, these hard-coded values are only used for the sake of a tutorial and rust_xlsxwriter provides APIs to handle these more programmatically. Let's start by looking at the chart ranges: # // SPDX-License-Identifier: MIT OR Apache-2.0
# //
# // Copyright 2022-2023, John McNamara, jmcnamara@cpan.org
# # //! A simple program to write some data to an Excel spreadsheet using
# //! rust_xlsxwriter. Part 4 of a tutorial.
# # use rust_xlsxwriter::{Chart, ExcelDateTime, Format, Formula, Workbook, XlsxError};
# # fn main() -> Result<(), XlsxError> {
# // Some sample data we want to write to a spreadsheet.
# let expenses = vec![
# ("Rent", 2000, "2022-09-01"),
# ("Gas", 200, "2022-09-05"),
# ("Food", 500, "2022-09-21"),
# ("Gym", 100, "2022-09-28"),
# ];
# # // Create a new Excel file object.
# let mut workbook = Workbook::new();
# # // Add a bold format to use to highlight cells.
# let bold = Format::new().set_bold();
# # // Add a number format for cells with money values.
# let money_format = Format::new().set_num_format("$#,##0");
# # // Add a number format for cells with dates.
# let date_format = Format::new().set_num_format("d mmm yyyy");
# # // Add a worksheet to the workbook.
# let worksheet = workbook.add_worksheet();
# # // Write some column headers.
# worksheet.write_with_format(0, 0, "Item", &bold)?;
# worksheet.write_with_format(0, 1, "Cost", &bold)?;
# worksheet.write_with_format(0, 2, "Date", &bold)?;
# # // Adjust the date column width for clarity.
# worksheet.set_column_width(2, 15)?;
# # // Iterate over the data and write it out row by row.
# let mut last_row = 1;
# for expense in &expenses {
# worksheet.write(last_row, 0, expense.0)?;
# worksheet.write_with_format(last_row, 1, expense.1, &money_format)?;
# # let date = ExcelDateTime::parse_from_str(expense.2)?;
# worksheet.write_with_format(last_row, 2, &date, &date_format)?;
# # last_row += 1;
# }
# # // Write a total using a formula.
# worksheet.write_with_format(last_row, 0, "Total", &bold)?;
# worksheet.write_with_format(last_row, 1, Formula::new("=SUM(B2:B5)"), &money_format)?;
# # // Add a chart to display the expenses.
# let mut chart = Chart::new_pie();
# # // Configure the data series for the chart. chart .add_series() .set_categories("Sheet1!$A$2:$A$5") .set_values("Sheet1!$B$2:$B$5");
# # // Add the chart to the worksheet.
# worksheet.insert_chart(1, 4, &chart)?;
# # // Save the file to disk.
# workbook.save("tutorial4.xlsx")?;
# # Ok(())
# } In general rust_xlsxwriter always numeric APIs for any ranges in Excel but sometimes also provides a secondary string based option. The previous example uses the secondary string based API for demonstration purposes but for real applications you would set the chart ranges we can using 5-tuple values like this: # // SPDX-License-Identifier: MIT OR Apache-2.0
