The page Setup "Page" dialog looks like this: Image of Page Setup Dialog Page section The equivalent rust_xlsxwriter methods are: worksheet.set_portrait() worksheet.set_landscape() worksheet.set_print_scale() worksheet.set_print_fit_to_pages() worksheet.set_print_first_page_number() Note, for worksheet.set_print_fit_to_pages() a common requirement is to fit the printed output to n pages wide but have the height be as long as necessary. To achieve this set the height to 0: # // SPDX-License-Identifier: MIT OR Apache-2.0
# //
# // Copyright 2022-2023, John McNamara, jmcnamara@cpan.org
# # //! The following example demonstrates setting the scale of the worksheet to fit
# //! a defined number of pages vertically and horizontally. This example shows a
# //! common use case which is to fit the printed output to 1 page wide but have
# //! the height be as long as necessary.
