It is occasionally necessary to lock all or parts of a worksheet to prevent unintentional editing. For example you may have certain fields that you want a user to update but have other instruction or calculation cells that you don't want modified. In Excel you do this by turning on the " Review -> Sheet Protect " option and in rust_xlsxwriter you can use the worksheet.protect() method: # // SPDX-License-Identifier: MIT OR Apache-2.0
