In the sections above we saw that dynamic array formulas can return variable sized ranges of results. The Excel documentation refers to this as a "Spilled" range/array from the idea that the results spill into the required number of cells. This is explained in the Microsoft documentation on Dynamic array formulas and spilled array behavior . Since a spilled range is variable in size a new operator is required to refer to the range. This operator is the Spilled range operator and it is represented by "#". For example, the range F2# in the image below is used to refer to a dynamic array returned by UNIQUE() in the cell F2: Image of spill output from app_dynamic_arrays.rs Unfortunately, Excel doesn't store the operator in the formula like this and in rust_xlsxwriter you need to use the explicit function ANCHORARRAY() to refer to a spilled range. The example in the image above was generated using the following formula: # // SPDX-License-Identifier: MIT OR Apache-2.0
