Excel 2010 and later versions added functions which weren't defined in the original file specification. These functions are referred to by Microsoft as "Future Functions". Examples of these functions are ACOT, CHISQ.DIST.RT , CONFIDENCE.NORM, STDEV.P, STDEV.S and WORKDAY.INTL. When written using worksheet.write_formula() these functions need to be fully qualified with a prefix such as _xlfn., as shown the table in the next section below. If the prefix isn't included you will get an Excel function name error. For example: # // SPDX-License-Identifier: MIT OR Apache-2.0
# //
# // Copyright 2022-2023, John McNamara, jmcnamara@cpan.org
# # //! The following example demonstrates writing an Excel "Future Function" without
# //! an explicit prefix, which results in an Excel error.
# # use rust_xlsxwriter::{Workbook, XlsxError};
# # fn main() -> Result<(), XlsxError> {
# let mut workbook = Workbook::new();
# let worksheet = workbook.add_worksheet();
# # // Write a future function without prefix. This gives an Excel error. worksheet.write_formula(0, 0, "=STDEV.S(B1:B5)")?;
# # // Write some data for the function to operate on.
# worksheet.write_number(0, 1, 1.23)?;
# worksheet.write_number(1, 1, 1.03)?;
# worksheet.write_number(2, 1, 1.20)?;
# worksheet.write_number(3, 1, 1.15)?;
# worksheet.write_number(4, 1, 1.22)?;
# # workbook.save("future_function.xlsx")?;
# # Ok(())
# } Image of output from doc_working_with_formulas_future1.rs If the _xlfn. prefix is included you will get the correct result: # // SPDX-License-Identifier: MIT OR Apache-2.0
# //
# // Copyright 2022-2023, John McNamara, jmcnamara@cpan.org
# # //! The following example demonstrates writing an Excel "Future Function" with
# //! an explicit prefix.
# # use rust_xlsxwriter::{Workbook, XlsxError};
# # fn main() -> Result<(), XlsxError> {
# let mut workbook = Workbook::new();
# let worksheet = workbook.add_worksheet();
# # // Write a future function with explicit prefix. worksheet.write_formula(0, 0, "=_xlfn.STDEV.S(B1:B5)")?;
# # // Write some data for the function to operate on.
# worksheet.write_number(0, 1, 1.23)?;
# worksheet.write_number(1, 1, 1.03)?;
# worksheet.write_number(2, 1, 1.20)?;
# worksheet.write_number(3, 1, 1.15)?;
# worksheet.write_number(4, 1, 1.22)?;
# # workbook.save("future_function.xlsx")?;
# # Ok(())
# } Image of output from doc_working_with_formulas_future2.rs Note : The function is displayed by Excel without the prefix. Alternatively you can use the worksheet.use_future_functions() function to have rust_xlsxwriter automatically handle future functions for you: # // SPDX-License-Identifier: MIT OR Apache-2.0
