} If we run this program we should get a spreadsheet that looks like this: Image of tutorial 1 This is a simple program but it demonstrates some of the steps that would apply to any rust_xlsxwriter program. The first step is to create a new workbook object using the Workbook constructor Workbook::new() : # // SPDX-License-Identifier: MIT OR Apache-2.0
