The previous example converted the required data into an Excel file but it looked a little bare. In order to make the information clearer we can add some simple formatting, like this: Image of tutorial 2 The differences here are that we have added "Item" and "Cost" column headers in a bold font, we have formatted the currency in the second column and we have made the "Total" string bold. To do this programmatically we can extend our code as follows: # // SPDX-License-Identifier: MIT OR Apache-2.0
# //
# // Copyright 2022-2023, John McNamara, jmcnamara@cpan.org
# # //! A simple program to write some data to an Excel spreadsheet using
# //! rust_xlsxwriter. Part 2 of a tutorial.
# use rust_xlsxwriter::{Format, Formula, Workbook, XlsxError}; fn main() -> Result<(), XlsxError> { // Some sample data we want to write to a spreadsheet. let expenses = vec![("Rent", 2000), ("Gas", 200), ("Food", 500), ("Gym", 100)]; // Create a new Excel file object. let mut workbook = Workbook::new(); // Add a bold format to use to highlight cells. let bold = Format::new().set_bold(); // Add a number format for cells with money values. let money_format = Format::new().set_num_format("$#,##0"); // Add a worksheet to the workbook. let worksheet = workbook.add_worksheet(); // Write some column headers. worksheet.write_with_format(0, 0, "Item", &bold)?; worksheet.write_with_format(0, 1, "Cost", &bold)?; // Iterate over the data and write it out row by row. let mut row = 1; for expense in &expenses { worksheet.write(row, 0, expense.0)?; worksheet.write_with_format(row, 1, expense.1, &money_format)?; row += 1; } // Write a total using a formula. worksheet.write_with_format(row, 0, "Total", &bold)?; worksheet.write_with_format(row, 1, Formula::new("=SUM(B2:B5)"), &money_format)?; // Save the file to disk. workbook.save("tutorial2.xlsx")?; Ok(())
} The main difference between this and the previous program is that we have added two Format objects that we can use to format cells in the spreadsheet. Format objects represent all of the formatting properties that can be applied to a cell in Excel such as fonts, number formatting, colors and borders. This is explained in more detail in the Format struct documentation. For now we will avoid getting into the details of Format and just use a limited amount of the its functionality to add some simple formatting: # // SPDX-License-Identifier: MIT OR Apache-2.0
